import '../css/Header.css';
import {Link} from "react-router-dom";

const Header = () => {

    const handleOnClick = () => {
        window.location.reload(true);

    }


    return (
        <div className='Header'>
            <Link id='headerLink' onClick={handleOnClick} to='/'> W </Link>
        </div>
    );
}

export default Header;
